import React, { Component } from 'react';

export class SingleUser extends Component {
  render() {
    const { login, avatar_url, url, blog, location, hireable } = this.props;
    return (
    <div>
      {login, avatar_url,location}
    </div>);
  }
}

export default SingleUser;
